import React from 'react';

import $ from "jquery";

import "./fullheader.css"

export default class fullheader extends React.Component {


	constructor(props) {
		super(props);
	}
	componentDidMount(){
		function openNav() {
			console.log("in Log");
		  document.getElementById("myNav").style.width = "100%";
		}

		function closeNav() {
		  document.getElementById("myNav").style.width = "0%";
		}

	}

	render() {
		return (
			<div className="col-lg-12" >
				 <div id="myNav" class="overlay1">
  <a href="javascript:void(0)" class="closebtn1" onClick="closeNav()">&times;</a>
  <div class="overlay-content1">
    <a href="#">About</a>
    <a href="#">Services</a>
    <a href="#">Clients</a>
    <a href="#">Contact</a>
  </div>
</div>


<span className="customSpan" onClick="openNav()">&#9776; open</span>
			</div>
		);
	}
}
